INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(1, '2017-09-19 00:00:00', 'Le miel de ch?taignier est un produit qui porte le nom de son arbre d?origine. Les Castanea sativa Mill, de la famille des fagac?es, comme le ch?ne et le h?tre, sont de grands producteurs de pollen. Ces arbres sont surtout connus pour secr?ter du miellat et non du nectar. Or, le ch?taignier fait exception ? cette r?gle, par le fait qu?il secr?te du nectar et ?ventuellement du miellat. Quant ? son pollen, tr?s abondant, il se retrouve dans les miels r?colt?s au printemps.', 'Miel de ch?taignier', 'mielChataignier.jpg', 5.95, 50, 4, 21);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(2, '2017-09-19 00:00:00', 'Aux vertus apaisantes, ce miel d?un jaune clair ou fonc? a un go?t fortement menthol?, frais, sans acidit?, mais l?g?rement amer. Issu des fleurs du m?me nom, le miel de tilleul a un usage reconnu pour traiter les troubles d?insomnie. ', 'Miel de tilleul', 'miel-de-tilleul.jpg', 8.35, 60, 4, 21);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(3, '2017-09-19 00:00:00', 'Le miel de sarrasin est originaire du continent am?ricain. Longtemps consid?r? comme l\'embl?me de la Bretagne, il fut un temps o? il a failli disparaitre. Mais aujourd\'hui, il reprend peu ? peu du terrain et il est connu surtout comme miel de cru.', 'Miel de sarrasin', 'mielSarrasin.jpg', 9.25, 30, 4, 21);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(4, '2017-09-19 08:42:22', 'Magnifique cuv?e exub?rante et raffin?e en m?me temps. Ar?mes de fruits noirs, cacao et ?pices, bouche savoureuse et franche, tr?s aromatique, avec une belle trame m?re et go?teuse, de l\'?l?gance et un bel ?quilibre.', 'La Lionne 2015 Rouge', 'Lionne2015.png', 9.2, 140, 43, 22);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(5, '2017-09-19 08:42:22', 'Robe jaune dor? ? reflets verts. Le nez est explosif sur les fleurs blanches, les agrumes et le poivron vert bien m?r. Sauvignon de terroir ? la forte personnalit?, il explose en bouche d?veloppant ses ar?mes dans une trame beurr?e, presque poivr?e o? le poivron vert s\'enrobe de fleurs blanches, de pamplemousse et d\'une pointe anis?e. La cuv?e longue et fra?che pr?sente un bel ?quilibre en bouche.', 'La Lionne 2015 Blanc', 'LionneBlanc.jpg', 9.5, 56, 43, 22);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(6, '2017-09-19 00:00:00', 'Robe: p?tale de rose. Nez: fraise, framboise, pointe menthol?e? on reconna?t l?Engarran ros? ? son nez, une marque de fabrique qui se joue des mill?simes. Bouche: de la p?che de vigne ? une touche de groseille pour la douceur au palais, de la menthe froiss?e ? la cl?mentine pour r?veiller les papilles, ? la fois plein et frais, vif et long en bouche.', 'Vin ros?', 'roseEngarran.png', 9.5, 30, 43, 22);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(7, '2017-09-19 00:00:00', 'Le brocoli est un v?ritable d?lice vert qui se consomme sous tellement de formes et de textures qu?il est possible de jouer de sa saveur dans quantit? de pr?parations sal?es.', 'Brocoli', 'Brocolis.jpg', 3.5, 12, 32, 23);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(8, '2017-09-19 00:00:00', 'Le chou romanesco est une magnifique vari?t? de chou-fleur originaire d?Italie. C?est un l?gume-feuille de la famille du chou. Il est plus fin et un l?ger go?t de noix se d?gage de cette vari?t? de chou.', 'Chou romanesco', 'chouRomanesco.jpg', 4.5, 15, 34, 23);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(9, '2017-09-19 00:00:00', 'Les haricots mangetout sont une des vari?t?s de haricots verts. On les reconnait ? leur gousse allong?e sans parchemin et ? leur couleur verte ou jaune. M?rs, ils contiennent des graines tendres, parfois sans fil. ', 'Mange-tout', 'mangeTout.jpg', 2.5, 70, 35, 23);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(10, '2017-09-19 09:01:25', 'La pomme Ariane est ? la fois sucr?e et acidul?e, ferme et croquante, juteuse et p?tillante en bouche, pour une saveur authentique. Bicolore, d?un rouge profond et brillant  paillet? de lenticelles, Ariane marie ?l?gance et rusticit?.', 'Pomme Ariane', 'pommeAriane.jpg', 3.3, 45, 18, 24);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(11, '2017-09-19 09:01:25', 'La Gala est une pomme rouge issue du croisement entre la Kidd\'s Orange Red et la Golden Delicious. La vari?t? a ?t? cr??e en Nouvelle-Z?lande dans les ann?es 1930 par le p?pini?riste J.H. Kidd. Elle est disponible de septembre ? mai.', 'Pomme Gala', 'PommeGala.jpg', 2.5, 30, 18, 24);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(12, '2017-09-19 09:05:46', 'Disponible de septembre ? avril, la poire Conf?rence est la poire d?automne et d?hiver par excellence. Elle a en effet besoin d?une p?riode de froid pour se d?velopper. Vari?t? la plus produite en Europe, elle doit son succ?s ? sa tenue lors de l?affinage et de la conservation.', 'Poire Conf?rence', 'PoireConference.jpg', 3.5, 45, 19, 24);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(13, '2017-09-19 09:05:46', 'Un tr?sor de sant? !  Riche en germanium et s?l?nium, c\'est un aliment pr?cieux pour la sant?.  L\'ail violet est une vari?t? d\'automne, productive, pr?coce, violet. Bonne conservation.', 'Ail violet', 'AilViolet.jpg', 5.9, 75, 30, 25);
INSERT INTO `produit` (`id_produit`, `date_creation_produit`, `description_produit`, `libelle_produit`, `photo_produit`, `prix_produit`, `quantitestock_produit`, `id_categorie_tproduit`, `id_producteur_tproduit`) VALUES(14, '2017-09-19 09:09:46', 'L?oignon jaune, parfois appel? oignon paille, est le bulbe d?une plante potag?re de la famille des alliac?s et qui porte le m?me nom. Le bulbe de l?oignon est constitu? de feuilles claires, tr?s charnues, juteuses et fortes en go?t, recouvertes de fines pelures d?un jaune plus ou moins fonc?.', 'Oignon jaune', 'OignonJaune.jpg', 1.9, 25, 29, 25);
