INSERT INTO `recette` (`id_recette`, `descriptif_recette`, `libelle_recette`, `nbpers_recette`, `photo_recette`, `id_categorierecette_trecette`) VALUES(1, 'Temps de pr?paration : 10 min. Temps de cuisson : 10 min. Laver la m?che et les pousses d\'?pinard. R?server. D?couper des lamelles d\'Ossau-Iraty. ?plucher les ?chalotes, les ?mincer. Passer les champignons sous l\'eau et les essuyer rapidement sur un papier absorbant. Les couper en morceaux. Dans une po?le, faire revenir les ?chalotes dans le beurre mousseux. Ajouter les champignons. Pour la vinaigrette : Dans un bol, r?unir la fleur de sel, le poivre et le vinaigre. M?langer. Ajouter le miel et l\'huile de noisette. M?langer de nouveau puis r?server. Dans un beau saladier ou sur des assiettes, disposer le m?lange de salade. D?poser les champignons ti?des, parsemer de noisettes et des lamelles de fromage. Au moment de servir, arroser de vinaigrette.', 'Salade de champignons aux ?chalotes', 'pour 4 personnes', 'saladechampi.jpg', 1);
INSERT INTO `recette` (`id_recette`, `descriptif_recette`, `libelle_recette`, `nbpers_recette`, `photo_recette`, `id_categorierecette_trecette`) VALUES(2, 'Temps de pr?paration : 10 min. Temps de cuisson : 20 min. Peler et ?mincer l?oignon rouge. Peler les poires et d?couper la chair en gros cubes. Verser 1 cuiller?e ? soupe d?huile d?olive dans une casserole et faire blondir les oignons. Ajouter les poires et laisser cuire ? nouveau 2 minutes. Saupoudrer de paprika, ajouter les ch?taignes et 30 cl d?eau. Laisser cuire 15 minutes. Ajouter la cr?me, saler et poivrer. Mixer pour obtenir un m?lange onctueux. Go?ter et rectifier, si n?cessaire, l?assaisonnement en sel, poivre et paprika. Servir tr?s chaud avec des pignons de pin et des toasts de bleu.', 'Cr?me de poires et ch?taignes au paprika', 'pour 4 personnes', 'cremepoire.jpg', 1);
INSERT INTO `recette` (`id_recette`, `descriptif_recette`, `libelle_recette`, `nbpers_recette`, `photo_recette`, `id_categorierecette_trecette`) VALUES(3, 'Temps de pr?paration : 10 min. Temps de cuisson : 20 min. D?tacher les brocolis en bouquets, les plonger 30 secondes dans de l?eau bouillante sal?e, les ?goutter aussit?t, puis les plonger dans un saladier d?eau glac?e, les laisser refroidir environ 5 minutes et les ?goutter ? nouveau. Peler les carottes et les r?per en minces filets. D?cortiquer les crevettes. R?per la moiti? du zeste du citron sur une r?pe fine au-dessus d?un bol. M?langer le jus d?orange et 2 cuiller?es ? soupe de jus de citron dans le bol, ajouter l?huile, saler et fouetter le m?lange. D?tailler les bouquets de brocolis en lamelles (les plus minces possible) et les poser ? plat sur quatre assiettes. Ajouter les crevettes, napper de sauce et poivrer juste avant de d?guster.\r\n', 'Brocolis et crevettes en carpaccio', 'pour 4 personnes', 'brocolicrevette.jpg', 1);
INSERT INTO `recette` (`id_recette`, `descriptif_recette`, `libelle_recette`, `nbpers_recette`, `photo_recette`, `id_categorierecette_trecette`) VALUES(4, 'Temps de pr?paration : 45 min. Temps de cuisson : 20 min. Pour la cr?me de champignons : ?mincer l\'oignon, l\'ail et les clous de girofle, faire suer le tout ? feu doux, y ajouter les parures de champignons puis les liquides. Recouvrir d?un couvercle et cuire le tout pendant 30 ? 35 minutes. Une fois cuit, mixer le tout, passer ? la fine passoire. R?cup?rer 40 cl de ce liquide et le m?langer au kappa, amener le tout ? ?bullition, mixer et verser dans les assiettes de service. Filmer et r?server ? temp?rature ambiante. Pour le velout? de potiron : Couper le potiron en petits cubes et les d?poser dans une casserole, couvrir d\'un couvercle et laisser ? feu tr?s doux 20 minutes afin de faire ressortir l?eau de cuisson. Y ajouter le reste de la garniture ainsi que le liquide. Cuire 30 minutes, mixer et passer ? la passoire fine. R?server au chaud. Laver soigneusement les champignons au pinceau. Et r?server au frais. Pour le dressage :\r\nPo?ler les champignons ? l?huile d?olive, les assaisonner de fleur de sel. Puis les d?poser sur la cr?me de champignons. Parsemer de copeaux d?Appenzeller? ou servir avec une ou deux pointes de fromage Appenzeller? et proposer le velout? de potiron chaud ? part.', 'Cr?me de champignon veloute de potiron', 'pour 8 personnes', 'cremechampi.jpg', 1);
INSERT INTO `recette` (`id_recette`, `descriptif_recette`, `libelle_recette`, `nbpers_recette`, `photo_recette`, `id_categorierecette_trecette`) VALUES(5, 'Temps de pr?paration : 20 min. Temps de cuisson : 20 min. Cr?me parmesan : Pour la cr?me parmesan, faire suer les oignons dans le beurre, d?glacer au vin blanc et r?duire de deux tiers, ajouter la cr?me, mixer et incorporez le parmesan pr?alablement r?p?. R?server ? temp?rature ambiante. Cr?me de chou-fleur grill? : Parer les choux, une fois cuit, faire colorer dans 20 g de beurre a couvert en prenant soin de les colorer uniform?ment.\r\nMouiller avec le bouillon de l?gumes et laisser cuire 10 minutes ? fr?missement. Ajouter la cr?me et mixer. Assaisonner de sel et sucre. R?server ? temp?rature ambiante. Cuisson : Faire fondre le beurre dans un sautoir, y d?poser le chou et l?arroser sans cesse en augmentant la temp?rature au fur et ? mesure de fa?on ? ce qu\'il soit color? ? l?ext?rieur et fondant a l?int?rieur. (10 mn.) Finition et dressage : Dresser harmonieusement en prenant soin de disposer deux belles quenelles des deux cr?mes. Disposer le chou-fleur entre chaque quenelle, puis d?poser les feuilles de menthe bergamote.', 'Chou-fleur croustillant ', 'pour 4 personnes', 'choufleur.jpg', 2);
INSERT INTO `recette` (`id_recette`, `descriptif_recette`, `libelle_recette`, `nbpers_recette`, `photo_recette`, `id_categorierecette_trecette`) VALUES(6, 'Temps de pr?paration : 20 min. Temps de cuisson : 1h30. Pr?paration de la volaille : Allumer le four ? 180?C th. 6 Brosser la truffe et la couper en fines lamelles (r?server les petits morceaux pour les l?gumes). D?coller la peau de la volaille, glisser entre chair et peau les lamelles de truffe et la ficeler. Poser la poularde dans un grand plat ? four, peler les oignons, les couper en deux, les poser dans le plat, glisser au four et laisser cuire 30 minutes. Pr?paration des l?gumes : Peler et laver tous les l?gumes. Couper les navets en deux, le potimarron en tranches de 2 cm, les carottes et les panais en tron?ons de 5 cm. Lorsque le poulet aura cuit 30 minutes, r?partir les l?gumes autour, saler, verser dans le plat 1 dl d?eau et parsemer de brins de thym. Cuisson et finissions : Remettre le plat au four, laisser cuire encore 40 minutes et tourner les l?gumes de temps en temps.', 'Volaille truff?e et l?gumes d?automne', 'pour 6 personnes', 'volaillehiver.jpg', 2);
INSERT INTO `recette` (`id_recette`, `descriptif_recette`, `libelle_recette`, `nbpers_recette`, `photo_recette`, `id_categorierecette_trecette`) VALUES(7, 'Temps de pr?paration : 15 min. Temps de cuisson : 10 min. Pr?paration des magrets : Inciser la peau des magrets en faisant des croisillons, les saler et poivrer des deux c?t?s. Verser le miel dans une casserole, porter ? ?bullition, ajouter les ?pices (cardamome, coriandre, anis, geni?vre, cannelle, poivre) et laisser cuire 2 minutes. Cuisson des magrets : Faire chauffer une po?le antiadh?sive sans mati?re grasse, et, lorsqu?elle est bien chaude, y poser les magrets c?t? peau dessous afin que la graisse fonde. Laisser cuire 5 minutes, puis les retourner, laisser cuire 3 minutes et jeter le gras rendu. Verser le miel et les ?pices sur les magrets, les rouler dans le miel, et laisser cuire encore 2 minutes.', 'Magret de canard au miel ?pice', 'pour 4 personnes', 'canardmiel.jpg', 2);
INSERT INTO `recette` (`id_recette`, `descriptif_recette`, `libelle_recette`, `nbpers_recette`, `photo_recette`, `id_categorierecette_trecette`) VALUES(8, 'Temps de pr?paration : 10 min. Temps de cuisson : 0 min. Tailler finement les pommes en lamelles, laisser s?cher la salade verte et les lamelles pendant 20 minutes au four ? 180?C. \r\nPr?paration de vinaigrette : Faire bouillir pendant 3 minutes deux abricots secs dans un peu d?eau. ?goutter les abricots, et les mixer avec 5 cl d?huile de noisette, un trait de vinaigre de banyuls, salez et saupoudrer de poivre de Sarawak.', 'Feuille de ch?ne aux chips de pommes', 'pour 2 personnes', 'saladepomme.jpg', 2);
INSERT INTO `recette` (`id_recette`, `descriptif_recette`, `libelle_recette`, `nbpers_recette`, `photo_recette`, `id_categorierecette_trecette`) VALUES(9, 'Temps de pr?paration : 15 min. Temps de cuisson : 25 min. Pr?paration de la garniture : Peler le gingembre, le couper en fins b?tonnets. D?noyauter les pruneaux, les hacher ainsi que les abricots secs. Peler les pommes et les couper en lamelles de 1 cm d??paisseur. Faire fondre le beurre dans une sauteuse, ajouter le sucre, les lamelles de pomme, le gingembre, faire cuire 10 minutes en m?langeant souvent. Ajouter les fruits secs, m?langer, laisser cuire 2 minutes, puis retirer du feu. Casser les amandes et les givrettes en gros morceaux, les ajouter ? la pr?paration et m?langer. Pr?paration de la p?te : Allumer le four ? 210 ?C (th. 7). Casser l??uf en s?parant le blanc du jaune. Mettre ce dernier dans un bol avec 1 cuiller?e ? soupe d?eau et fouetter. Mettre la p?te dans le moule avec son papier sulfuris? en la laissant d?border largement. D?poser la pr?paration en forme de d?me sur la p?te, rabattre les bords vers le centre en les plissant et badigeonner de jaune d??uf. Mettre au four et laisser dorer 15 ? 20 minutes. Retirer du four, ajouter la gel?e de coing sur les fruits chauds, au contact desquels elle fond. Servir chaud ou ti?de, accompagn? de cr?me fouett?e.', 'Tourte aux pommes et aux amandes', 'pour 6 personnes', 'tourtepomme.jpg', 3);
INSERT INTO `recette` (`id_recette`, `descriptif_recette`, `libelle_recette`, `nbpers_recette`, `photo_recette`, `id_categorierecette_trecette`) VALUES(10, 'Temps de pr?paration : 20 min. Temps de cuisson : 20 min. Pr?paration de la p?te : Allumer le four ? 210 ?C (th 7). Beurrer les moules. Mixer les noix jusqu?? l?obtention d?une grosse semoule. Casser les ?ufs en s?parant les blancs des jaunes, mettre ces derniers dans un saladier. Ajouter le sucre, fouetter le m?lange durant 1 minute, lui ajouter les noix mix?es. Fouetter les blancs en neige, les incorporer d?licatement ? la pr?paration aux noix en alternance avec la farine, r?partir la p?te dans les deux moules beurr?s, lisser la surface, glisser au four et laisser cuire 12 minutes environ, jusqu?? ce que la surface soit juste dor?e. Retirer du four et d?mouler d?licatement les disques de p?te (car ces g?teaux sont souples) sur une grille ? p?tisserie. Pr?paration de la cr?me : Mixer finement les amandes et les cerneaux de noix avec 50 g de sucre. Fouetter les jaunes et le sucre restant, ajouter le m?lange aux noix et m?langer, incorporer les blancs battus en neige. Verser la cr?me dans une casserole, la poser sur feu doux et faire cuire 10 minutes environ, en tournant souvent, jusqu?? ce que la pr?paration ?paississe. Retirer du feu et laisser ti?dir. Dressage : Poser un disque de p?te sur un plat, ?taler dessus la cr?me encore ti?de, recouvrir du second disque de p?te en appuyant l?g?rement, laisser compl?tement refroidir. Avant de servir, poser sur le g?teau quelques cerneaux de noix, poudrer de sucre glace et ajouter une ou deux feuilles d?or.', 'G?teau tout noix', 'pour 6 personnes', 'gateaunoix.jpg', 3);
INSERT INTO `recette` (`id_recette`, `descriptif_recette`, `libelle_recette`, `nbpers_recette`, `photo_recette`, `id_categorierecette_trecette`) VALUES(11, 'Temps de pr?paration : 30 min. Temps de cuisson : 10 min. Lavez et ?grappez le raisin, ?talez les grains sur un plateau et entreposez-les 30 minutes au cong?lateur. Plantez un cure-dents dans la partie charnue de chaque amande, sans trop l\'enfoncer. Dans une petite casserole, faites un caramel ? sec sur feu moyen-vif. D?s qu\'il prend une belle couleur dor?e, trempez les amandes dedans, ? plusieurs reprises, jusqu\'? ce qu\'elles s\'enrobent enti?rement. Maintenez-les quelques instants au-dessus de la casserole jusqu\'? ce qu\'un fil se forme. D?posez-les au fur et ? mesure sur un plat huil? et laissez durcir. Recommencez ainsi pour toutes les amandes. Lorsque le caramel a bien pris, retirez d?licatement les cure-dents. Servez les raisins glac?s dans des coupes, sur un lit de glace pil?e et accompagnez-les des amandes caram?lis?es.', 'Salade de raisins blancs et amandes caram?lis?es', 'pour 6 personnes', 'raisin.jpg', 3);
INSERT INTO `recette` (`id_recette`, `descriptif_recette`, `libelle_recette`, `nbpers_recette`, `photo_recette`, `id_categorierecette_trecette`) VALUES(12, 'Temps de pr?paration : 15 min. Temps de cuisson : 25 min. Pr?chauffez le four th 6 ( 180?). Garnissez un moule rectangulaire avec la p?te en conservant le papier sulfuris?. Epluchez les poires, coupez les en deux, ?videz le c?ur et retirez la queue. Arrosez-les avec le jus du citron. M?langez le mascarpone avec les ?ufs et le sucre semoule. Tapissez le moule avec cette pr?paration et rangez les poires en les enfon?ant t?te-b?che. Saupoudrez la tarte d?amandes hach?es et de sucre glace. Enfournez et laissez cuire 25 minutes en surveillant la coloration. Servez ti?de.', 'Tarte ? la poire et au mascarpone', 'pour 6 personnes', 'tartepoire.jpg', 3);
